import { useNavigate } from "react-router-dom";
import { CountryModel } from "../../../Models/CountryModel";
import "./CountryCard.css";

type CountryCardProps = {
    country: CountryModel;
};

export function CountryCard(props: CountryCardProps): JSX.Element {

    const navigate = useNavigate();

    function showDetails(): void {
        navigate("/country-details" + props.country.name)
    }

    return (
        <div
            className="CountryCard"
            onClick={showDetails}
            role="button"
            aria-label={`View details of ${props.country.name}`}
        >
            <div className="CountryDetails">
                <span>Country: {props.country.name}</span>
                <span>Capltal City: {props.country.capital}</span>
                <span>{props.country.population}</span>
                <span>{props.country.name}</span>
                <span>{props.country.name}</span>
            </div>

        </div>
    );
}
